import React, { useEffect, useState } from 'react';
import {
    View,
    Text,
    StyleSheet,
    TouchableOpacity,
    Alert,
    TextInput,
    Modal,
    ScrollView,
    Image,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import * as SecureStore from 'expo-secure-store';
import { router } from 'expo-router';
import { Feather } from '@expo/vector-icons';
import BottomBar from './bottombar';

const Profile = () => {
    const [userData, setUserData] = useState(null);
    const [isEditing, setIsEditing] = useState(false);
    const [editData, setEditData] = useState({});
    const [showChart, setShowChart] = useState(false);

    const fetchUserData = async () => {
        try {
            const storedData = await SecureStore.getItemAsync('userData');
            if (storedData) {
                setUserData(JSON.parse(storedData));
            }
        } catch (error) {
            console.error('Error fetching user data:', error);
            Alert.alert('Error', 'Unable to fetch user data');
        }
    };

    const saveUpdatedData = async () => {
        try {
            // Validate input fields
            if (!editData.name || !editData.mobile) {
                Alert.alert('Validation Error', 'Name and Mobile are required fields');
                return;
            }

            await SecureStore.setItemAsync('userData', JSON.stringify(editData));
            setUserData(editData);
            setIsEditing(false);
            Alert.alert('Success', 'Profile updated successfully');
        } catch (error) {
            console.error('Error saving updated profile:', error);
            Alert.alert('Error', 'Failed to update profile');
        }
    };

    const handleLogout = () => {
        Alert.alert(
            'Confirm Logout',
            'Are you sure you want to log out?',
            [
                {
                    text: 'Cancel',
                    style: 'cancel',
                },
                {
                    text: 'Log Out',
                    style: 'destructive',
                    onPress: async () => {
                        try {
                            await SecureStore.deleteItemAsync('userData');
                            await SecureStore.deleteItemAsync('isLoggedIn');
                            router.replace('/login');
                        } catch (error) {
                            console.error('Error during logout:', error);
                            Alert.alert('Error', 'Failed to log out');
                        }
                    },
                },
            ],
            { cancelable: false }
        );
    };


    useEffect(() => {
        fetchUserData();
    }, []);

   

    const toggleChart = () => setShowChart(!showChart);
    if (!userData) {
        return (
            <>
                <LinearGradient
                    colors={['#4169E1', '#1A4B84']}
                    style={styles.container}
                >


                    <View style={styles.headerGradient}>
                        <Text style={styles.headerText}>Welcome to FitTrack</Text>
                        <Text style={styles.subHeaderText}>
                            Track your fitness journey with personalized insights
                        </Text>
                    </View>
                    <View style={styles.chartContainer}>
                        <Image
                            source={{
                                uri: "data:image/png;base64,"
                            }}
                            style={{
                                width: 350, // Set width
                                height: 250, // Set height
                                resizeMode: 'cover', // Optional: Adjust image scaling
                                borderRadius: 10, // Optional: Add rounded corners
                            }}
                        />


                    </View>
                    <View style={styles.buttonContainer}>
                        <TouchableOpacity
                            style={[styles.button, styles.logInButton]}
                            onPress={toggleChart} // Show chart on button press
                        >
                            <Feather name="log-in" size={24} color="#fff" onPress={() => { router.push('/login') }} />
                            <Text style={styles.buttonText} onPress={() => { router.push('/login') }}>Login</Text>
                        </TouchableOpacity>
                        <TouchableOpacity
                            style={[styles.button, styles.signUpButton]}
                            onPress={toggleChart} // Show chart on button press
                        >
                            <Feather name="user-plus" size={24} color="#4169E1" onPress={() => { router.push('/register') }} />
                            <Text style={[styles.buttonText, styles.signUpButtonText]} onPress={() => { router.push('/register') }} >Register</Text>
                        </TouchableOpacity>
                    </View>

                    <View>
                        <TouchableOpacity
                            style={[styles.button, styles.adminbtn]}
                            onPress={toggleChart}
                        >
                            <Feather name="user-plus" size={24} color="#fff" onPress={() => { router.push('/signup') }} />
                            <Text style={[styles.buttonText,]} onPress={() => { router.push('/signup') }}>Admin</Text>
                        </TouchableOpacity>
                    </View>




                </LinearGradient>
                <BottomBar />
            </>
        );
    }


    return (
        <>
            <LinearGradient
                colors={['#4169E1', '#1A4B84']}
                style={styles.container}
            >
                <ScrollView
                    contentContainerStyle={styles.scrollContainer}
                    showsVerticalScrollIndicator={false}
                >
                    {/* Profile Header */}
                    <View style={styles.profileHeader}>
                        <View style={styles.profileAvatarContainer}>
                            <Feather name="user" size={80} color="#fff" />
                        </View>
                        <Text style={styles.profileName}>
                            {userData.name || 'User Profile'}
                        </Text>
                    </View>

                    {/* Profile Information Section */}
                    <View style={styles.profileInfoContainer}>
                        <Text style={styles.sectionTitle}>Personal Information</Text>

                        <View style={styles.infoRow}>
                            <View style={styles.infoItem}>
                                <Feather name="user" size={20} color="#4169E1" />
                                <View style={styles.infoTextContainer}>
                                    <Text style={styles.infoLabel}>Name</Text>
                                    <Text style={styles.infoValue}>
                                        {userData.name || 'Not Set'}
                                    </Text>
                                </View>
                            </View>

                            <View style={styles.infoItem}>
                                <Feather name="phone" size={20} color="#4169E1" />
                                <View style={styles.infoTextContainer}>
                                    <Text style={styles.infoLabel}>Mobile</Text>
                                    <Text style={styles.infoValue}>
                                        {userData.phone || 'Not Set'}
                                    </Text>
                                </View>
                            </View>
                        </View>

                        <View style={styles.infoRow}>
                            <View style={styles.infoItem}>
                                <Feather name="arrow-up" size={20} color="#4169E1" />
                                <View style={styles.infoTextContainer}>
                                    <Text style={styles.infoLabel}>Height</Text>
                                    <Text style={styles.infoValue}>
                                        {userData.height ? `${userData.height} cm` : 'Not Set'}
                                    </Text>
                                </View>
                            </View>

                            <View style={styles.infoItem}>
                                <Feather name="arrow-down" size={20} color="#4169E1" />
                                <View style={styles.infoTextContainer}>
                                    <Text style={styles.infoLabel}>Weight</Text>
                                    <Text style={styles.infoValue}>
                                        {userData.weight ? `${userData.weight} kg` : 'Not Set'}
                                    </Text>
                                </View>
                            </View>
                        </View>

                        <View style={styles.infoRow}>
                            <View style={styles.infoItem}>
                                <Feather name="target" size={20} color="#4169E1" />
                                <View style={styles.infoTextContainer}>
                                    <Text style={styles.infoLabel}>Fitness Goal</Text>
                                    <Text style={styles.infoValue}>
                                        {userData.goal || 'Not Set'}
                                    </Text>
                                </View>
                            </View>
                        </View>
                    </View>

                    {/* Action Buttons */}
                    <View style={styles.actionButtons}>
                        <TouchableOpacity
                            style={styles.editButton}
                            onPress={() => {
                                setEditData({ ...userData });
                                setIsEditing(true);
                            }}
                        >
                            <Feather name="edit" size={20} color="#fff" />
                            <Text style={styles.buttonText}>Edit Profile</Text>
                        </TouchableOpacity>

                        <TouchableOpacity
                            style={styles.logoutButton}
                            onPress={handleLogout}
                        >
                            <Feather name="log-out" size={20} color="#fff" />
                            <Text style={styles.buttonText}>Logout</Text>
                        </TouchableOpacity>
                    </View>
                </ScrollView>
            </LinearGradient>

            <EditProfileModal
                visible={isEditing}
                editData={editData}
                setEditData={setEditData}
                onSave={saveUpdatedData}
                onCancel={() => setIsEditing(false)}
            />

            <BottomBar />
        </>
    );
};

// Reusable component for profile detail items
const ProfileDetailItem = ({ icon, label, value }) => (
    <View style={styles.profileItem}>
        <Feather name={icon} size={24} color="#333" />
        <View style={styles.profileItemText}>
            <Text style={styles.profileDetailLabel}>{label}:</Text>
            <Text style={styles.profileText}>{value}</Text>
        </View>
    </View>
);

// Modal for editing profile
const EditProfileModal = ({
    visible,
    editData,
    setEditData,
    onSave,
    onCancel
}) => (
    <Modal
        visible={visible}
        animationType="slide"
        transparent={true}
    >
        <View style={styles.modalOverlay}>
            <View style={styles.modalContent}>
                <Text style={styles.editFormTitle}>Edit Profile</Text>
                <ScrollView
                    contentContainerStyle={styles.editForm}
                    showsVerticalScrollIndicator={false}
                >
                    <ProfileInput
                        placeholder="Name"
                        value={editData.name}
                        onChangeText={(text) => setEditData({ ...editData, name: text })}
                    />
                    <ProfileInput
                        placeholder="Mobile"
                        value={editData.mobile}
                        onChangeText={(text) => setEditData({ ...editData, mobile: text })}
                        keyboardType="phone-pad"
                    />
                    <ProfileInput
                        placeholder="Height (cm)"
                        value={editData.height}
                        onChangeText={(text) => setEditData({ ...editData, height: text })}
                        keyboardType="numeric"
                    />
                    <ProfileInput
                        placeholder="Weight (kg)"
                        value={editData.weight}
                        onChangeText={(text) => setEditData({ ...editData, weight: text })}
                        keyboardType="numeric"
                    />
                    <ProfileInput
                        placeholder="Fitness Goal"
                        value={editData.fitnessGoal}
                        onChangeText={(text) => setEditData({ ...editData, fitnessGoal: text })}
                    />

                    <View style={styles.modalButtonContainer}>
                        <TouchableOpacity
                            style={styles.saveButton}
                            onPress={onSave}
                        >
                            <Text style={styles.saveButtonText}>Save</Text>
                        </TouchableOpacity>
                        <TouchableOpacity
                            style={styles.cancelButton}
                            onPress={onCancel}
                        >
                            <Text style={styles.cancelButtonText}>Cancel</Text>
                        </TouchableOpacity>
                    </View>
                </ScrollView>
            </View>
        </View>
    </Modal>
);

